import React from 'react'
import { useState, useEffect } from "react";
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
export default function AdoptForm() {

  const [adoption_status, setAdoptionStatus] = useState(null);
  const [type, setType] = useState(null);


  const [ Adopt, setAdopt ] = useState(null);

  //if adoption_status from from checked to unchecked, setAdoptionStatus to null
  const handleAdoptStatus = (e) => {
    if (e.target.checked) {
      setAdopt(e.target.value);
    } else {
      setAdopt(null);
    }
  };




  //listen when adoption_status changes, and console.log is checked or unchecked and console.log the value
  useEffect(() => {
    console.log("adopt", Adopt);
  }, [Adopt]);


  //make a switch statment that check all the possible values of adoption_status and return an array of the checked values
  const handleAdoptionStatus = () => {
    switch (Adopt) {

      case "adopted":
        console.log();
        return [Adopt];
      case "available":
        return [Adopt];
      case "foster":
        return [Adopt];
      default:
        return [];
    }
  };




  return (
    <div>
              <Form>
          {/* <fieldset disabled>  */}
           {/* <Form.Select aria-label="Default select example">
            <option>Adoption Status</option>
            <option value="1">Adopt</option>
            <option value="2">Available</option>
          </Form.Select> */}
          <h5>Adoption Status</h5>
          <Form.Check
            reverse
            label="Adopted"
            name={"adopted"}
            value={"adopted"}
            onChange={(e) => handleAdoptionStatus(e ,"adopted")}

          />
          <Form.Check
            reverse
            label="Available"
            value={"Available"}
            onChange={(e) => handleAdoptionStatus(e ,"available")}
          />
          <Form.Check
            reverse
            label="Foster"
            value={"Foster"}
            onChange={(e) => handleAdoptionStatus(e ,"foster")}
          />
          <h5>Type</h5>
          <Form.Check
            reverse
            label="Dog"

          />
          <Form.Check
            reverse
            label="Cat"
          />
                    <Form.Check
            reverse
            label="Other"
          />

          {/* <Form.Select aria-label="Default select example">
            <option>Type</option>
            <option value="1">Dog</option>
            <option value="2">Cat</option>
          </Form.Select> */}
          <Form.Select aria-label="Default select example">
            <option>Heights</option>
            <option value="1">less then 10cm</option>
            <option value="2">10cm-20cm</option>
            <option value="3">20cm-30cm</option>
            <option value="4">30cm-40cm</option>
            <option value="5">40cm-50cm</option>
            <option value="6">50cm-60cm</option>
            <option value="7">more then 60cm</option>
          </Form.Select>
          <Form.Select aria-label="Default select example">
            <option>Weight</option>
            <option value="1">2kg-4kg</option>          
            <option value="2">2kg-4kg</option>
            <option value="3">4kg-6kg</option>
            <option value="4">6kg-8kg</option>
            <option value="5">8kg-10kg</option>
            <option value="6">10kg-20kg</option>
            <option value="7">20kg-30kg</option>
            <option value="8">30kg-40kg</option>
            <option value="9">more then 40kg</option>
          </Form.Select>


        {/* create bootstrap range with two balls on one like and display minumun display maximum */}
          <Form.Group className="mb-3" controlId="formBasicRange">
            <Form.Label>Range</Form.Label>
            <h5
            >{"value1"}
            </h5>

            <Form.Control type="range" />

          </Form.Group>
          <Form.Group className="mb-3" controlId="formBasicRange">
            <Form.Label>Range</Form.Label>
            <h5
            >{"value2"}
            </h5>
            <Form.Control type="range" />
          </Form.Group>

          <Form.Label >Name</Form.Label>
        <Form.Control
        type="text"
        placeholder="Enter Name"
      />



            {/* <Button type="submit">Submit</Button> */}
          {/* </fieldset> */}
        </Form>
    </div>
  )
}
